/**列出为于 `dirPath` 路径下所有后缀名为 `last` 的文件列表对象
 * @return `line: any[]` `name: any[]` `path: any[]`
 */
export function getFileList(dirPath?: string, last?: string): Object;
/**将对象 `object` 中的 `output` 数组中名字对应的对象值转换为可直接在控制台输出的列表 
 * @return ```js
 * objectToTable({ a: [1, 2, 3], b: ["a", "b", "c"], c: [10, 20, 30] }, ["a", "b", "c"])
 * //   [
 * //    'i | a | b | c ',
 * //    '0 | 1 | a | 10',
 * //    '1 | 2 | b | 20',
 * //    '2 | 3 | c | 30'
 * //   ]
 * ```
*/
export function objectToTable(object: object, output: any[]): any[];